import React from 'react';
import { Form, FormField, Button, TextInput } from 'grommet';

function InputForm() {

  const theme = {
    global: {
      colors: {
        border: 'dark',
        brand: '#01A982',
      },
      font: {
        family: 'Roboto',
        size: '18px',
        height: '20px',
      },
    },
  };

  return(
    <Form theme={theme}>
      <FormField label="Requestor">
        <TextInput placeholder="Enter Requestor" />
      </FormField>
      <FormField label="PR Number">
        <TextInput placeholder="Enter PR Number" />
      </FormField>
      <FormField label="PO Number">
        <TextInput placeholder="Enter " />
      </FormField>
    </Form>
  );
}


export default InputForm;
